@app.route("/chartdata")
def license():

    license_test = engine.execute(
        'SELECT field3, COUNT(field3) AS "countBiz" FROM licenses  GROUP BY field3')

    
    rows = list(license_test.fetchall())
    counts = []
    liquor_type = []
    for row_result in rows:
        counts.append(row_result[1])#["countBiz"])
        liquor_type.append(row_result[0])#["field3"])

    # return "hey"  # jsonify(trace)
    return jsonify({
        "x":liquor_type,
        "y":counts, 
        "type": "bar"
        
    })


