@app.route("/piedata")
def license_pie():

    license_test = engine.execute(
        "SELECT field3, COUNT(field3) AS countBiz FROM licenses  GROUP BY field3")

    rows = list(license_test.fetchall())
    counts = []
    liquor_type = []
    for row_result in rows:
        counts.append(row_result[1])#0])#"countBiz"])
        liquor_type.append(row_result[0])#1])#"field3"])

    return jsonify({
        "labels":liquor_type,
        "values":counts, 
        "type": "pie"
        
    })


